import React from 'react';
import { Router, Route, Switch} from 'react-router-dom'
import logo from './logo.svg';
import './App.css';
import LeaderboardView from './components/leaderboard';
import LeaderboardDashboard from './components/leaderboardDashboard';
import Login from './components/login';
import Index from './components';
import Home from './components/home';
import Wallet from './components/wallet';
import MainComponent from './components/main'
import history from './history'
import PVPHome from './components/pvpHome';


function App() {
  return (
    <div className="app">
     <Router history={history}>
       <Switch>
        <Route path="/login/" component={MainComponent} />  
        <Route path="/logintest/:type" exact component={MainComponent} />
        <Route path="/home" extact component={Home} />
        <Route path="/wallet" extact component={Wallet} />
        <Route path="/pvp" extact component={PVPHome} />
        <Route path="/game/:gameId" extact component={PVPHome} />
       </Switch>
    </Router>
    </div>
  );
}

export default App;
